    bio: "LOUD is a Brazilian esports and entertainment organization that has become the most followed esports brand in the world by social media metrics, with over 40 million followers across platforms. Founded by content creator Bruno 'PlayHard' Bittencourt, LOUD leveraged Brazil's massive and passionate gaming community to build an audience that dwarfs traditional esports organizations. Their Valorant roster won Champions 2022, defeating OpTic Gaming in the grand final to become the first Brazilian team to win a Valorant world championship. That victory cemented LOUD as more than just a content organization â€” they're legitimate world champions. LOUD's model of combining massive content reach with competitive excellence has created arguably the most powerful esports brand in terms of raw audience size.",
