    bio: "Karmine Corp is a French esports organization founded in 2020 by content creators Kameto and Prime that has taken the French esports scene by storm with unprecedented fan engagement. KC's fanbase, known as the 'Blue Wall,' fills arenas and dominates social media during matches with a fervor that rivals traditional European football supporters. Their League of Legends team competes in the LEC after dominating the French league (LFL), and their Rocket League team has been among the best in Europe. Karmine Corp also expanded into Valorant. The organization's rise from a streamer project to a legitimate tier-one European org in just a few years is one of the most remarkable growth stories in esports. KC proved that passionate community building can create an esports powerhouse from scratch.",
