export const GAME_DESCRIPTIONS = {
  "CS2": "The Logitech G Pro X Superlight 2 reigns supreme in Counter-Strike 2 at 23%, a title where precision and consistency are valued above all else. CS2 pros tend to be more conservative with gear changes than players in any other esport â€” some have been using the same mouse shape for five or six years straight, and the Superlight 2's proven shape and flawless HERO 2 sensor make it the safest choice at the highest level. The Razer Viper V3 Pro is gaining ground fast at 15%, driven by its lighter 54g weight and 8KHz polling that appeals to a new generation of fraggers who came up watching s1mple and ZywOo. The original Superlight still commands a loyal 10% following, proving that many pros simply refuse to abandon a shape that carried them through years of tournament play â€” there's a reason the phrase 'if it ain't broke, don't fix it' resonates so deeply in the CS community. Razer's DeathAdder V4 Pro at 9% shows that ergonomic mice still have a strong home in CS2, particularly among AWPers and support players who value comfort in marathon sessions. What's fascinating about CS2's mouse landscape is the sheer inertia â€” the average pro has been using their current mouse shape for over two years, which is an eternity in an industry that releases new flagship models every six months. Zowie's continued 8% presence, despite not having cutting-edge specs, is a testament to how much shape familiarity matters when you're playing for $1M prize pools.",
  "Valorant": "The Razer Viper V3 Pro dominates Valorant at a commanding 30% usage rate, more than triple its nearest competitor. Valorant's emphasis on ultra-precise crosshair placement and flick-heavy duels rewards the Viper V3 Pro's 54g weight and zero-debounce optical switches. The original Logitech G Pro X Superlight holds second at 10%, a testament to its enduring popularity among players who entered competitive Valorant during its early days. The Superlight 2 follows closely at 9%, gradually replacing its predecessor as pros upgrade their setups. Razer's overall brand dominance at 51% in Valorant is remarkable and largely unmatched in any other major esports title, reflecting how effectively the Viper V3 Pro has captured the tactical FPS audience. One notable pattern is the sensitivity divide: Valorant pros run significantly lower eDPI than almost any other game, with many duelists playing at sub-250 eDPI, which means they're making massive arm movements for every crosshair adjustment. That playstyle heavily favors ultralight mice with low static friction â€” exactly what the Viper V3 Pro delivers.",
  "Fortnite": "The Razer Viper V3 Pro leads Fortnite at 33%, where the game's unique combination of building mechanics and aim duels demands both speed and precision. Fortnite is mechanically unlike any other esport â€” pros need mice that can handle rapid 180-degree flicks during build fights, smooth tracking while editing walls at lightning speed, and then immediately transition to pixel-perfect precision for shotgun flick duels. This is why Fortnite has one of the highest average eDPIs among competitive FPS titles. The original Logitech G Pro X Superlight remains hugely popular at 16%, as many Fortnite pros have been using it since the game's competitive peak and see no reason to switch. The Superlight 2 follows at 11% as the natural upgrade path. Finalmouse maintains an 8% brand share here, reflecting the brand's deep roots in the Fortnite community through high-profile players who popularized ultralight mice in the battle royale scene during the Chapter 1 and Chapter 2 era.",
  "LoL": "Logitech absolutely dominates League of Legends with 63% total brand share, the highest single-brand concentration in any major esports title we track. The G Pro X Superlight 2 leads at 20%, followed by the original Superlight at 14% and the G Pro Wireless at 8% â€” three Logitech mice taking the top three spots. League pros prioritize comfort and reliability over raw weight since the game demands constant clicking over long sessions rather than explosive flick aiming. Competitive League matches regularly run 30-45 minutes, and a best-of-five series can stretch past three hours of continuous play, so wrist fatigue is a much bigger factor than in round-based FPS games. The Razer Viper V3 Pro appears at just 6%, reflecting that Valorant and CS2's ultralight meta hasn't fully crossed over into MOBA territory. Higher DPI settings are common here too, with an average of 1,443 DPI compared to CS2's 656, since League requires fast cursor movement across large screen areas. There's also a regional dimension worth noting: Korean and Chinese League pros tend to favor different mice than their Western counterparts, with Logitech even more dominant in LCK where team-wide sponsor deals often dictate peripheral choices.",
  "R6 Siege": "Rainbow Six Siege shows one of the most evenly split mouse markets in esports, with the Razer Viper V3 Pro leading at just 15% followed closely by the Superlight 2 at 12% and original Superlight at 11%. This three-way race reflects Siege's unique gameplay that blends precise angle-holding with fast entry fragging. The DeathAdder V4 Pro and Superlight 2 Dex both sit at 6%, showing that ergonomic shapes have a strong following among Siege pros who spend significant time holding tight pixel angles. Logitech edges out Razer in overall brand share at 37% to 33%, with Zowie maintaining a respectable 10% driven by EC2 loyalists from the game's earlier competitive era.",
  "PUBG": "PUBG's mouse landscape tells a story of a game whose pro scene crystallized during the Logitech Superlight era and then essentially froze in place. The original G Pro X Superlight commands a massive 36% share â€” the highest single-mouse dominance in any game we track â€” reflecting how many PUBG pros locked in their setups years ago and simply haven't switched. In a game where a single tournament can last an entire weekend of matches, comfort and familiarity with your aim aren't just preferences, they're competitive necessities. Logitech holds 54% total brand share, with the G Pro Wireless adding another 7% from players still using the 2018 classic. Zowie maintains 18% brand share, the second-highest Zowie presence in any title, driven by FK2 and EC2 loyalists from PUBG's golden competitive era when those shapes were the go-to choice for virtually every serious FPS player. The Razer Viper V3 Pro has only penetrated 5% of the market, suggesting PUBG pros are among the most resistant to switching gear in all of esports â€” a fascinating contrast with Valorant, where the same mouse dominates at 30%.",
  "Apex": "Apex Legends shows a remarkably balanced mouse market with Logitech and Razer tied at 29% brand share each, reflecting the game's diverse mechanical demands. The Viper V3 Pro leads individual models at 16%, but the Superlight and Superlight 2 combine for 22%, showing the Logitech ecosystem's combined strength. Finalmouse holds a notable 13% brand share â€” one of their strongest showings in any title â€” driven by the movement-heavy, flick-intensive playstyle that Apex rewards. Lamzu appears at 7%, higher than most titles, suggesting Apex pros are more willing to experiment with newer boutique brands. The average eDPI of 1,274 is significantly higher than tactical shooters, reflecting Apex's need for fast 360-degree tracking during movement-heavy gunfights where you might need to spin on a Pathfinder grappling above you while simultaneously tracking a Wraith phasing through your line of sight.",
  "Dota 2": "Dota 2's mouse preferences diverge significantly from the FPS-dominated landscape, with Razer leading at 44% brand share primarily through the DeathAdder line rather than the Viper. This is telling â€” Dota pros don't need ultralight flick machines; they need comfortable, reliable mice that won't cause wrist strain during games that regularly exceed 40 minutes. The DeathAdder V3 Pro and V2 variants combine for a significant presence, as Dota pros favor the ergonomic comfort of the DeathAdder for these marathon sessions. Unlike FPS titles, the top mouse in Dota 2 only commands 9%, showing extreme fragmentation with no single model dominating. HyperX holds 14% share â€” their strongest presence in any title â€” reflecting the brand's long-standing relationships with Dota teams in CIS and Asian regions. With only 28% wireless adoption, Dota 2 has the lowest wireless rate of any game we track, suggesting pros here are the least concerned about cutting-edge peripheral technology. Many Dota pros openly say they'd use whatever mouse is comfortable â€” the idea of optimizing your mouse for a few milliseconds of advantage, while crucial in CS2, is almost irrelevant in a game decided by macro strategy and teamfight execution.",
  "Marvel Rivals": "Marvel Rivals shows a mouse distribution similar to Overwatch 2, which makes sense given the shared hero-shooter DNA between the two games. The Superlight 2 and Viper V3 Pro are neck and neck at 19% and 10% respectively, with the DeathAdder V3 Pro and original Superlight also tied at 10%. Logitech leads brand share at 38% with Razer close behind at 33%, and Pulsar has carved out a 10% niche. The average eDPI of 1,767 is among the highest across FPS titles, reflecting the fast-paced, ability-heavy gameplay. As a newer esports scene, Marvel Rivals players appear more willing to experiment with diverse mouse brands compared to the more entrenched CS2 or Valorant communities.",
  "Overwatch 2": "Overwatch 2's professional scene is split almost perfectly between two mice: the Razer Viper V3 Pro and Logitech G Pro X Superlight 2, each commanding 44% of the market. This near-perfect duopoly is unique across esports and reflects the OWL legacy where Razer and Logitech were the dominant sponsors throughout the league's history. The DeathAdder V3 Pro picks up the remaining 13%, showing that some tank and support players still prefer ergonomic comfort for extended matches. What makes Overwatch 2 particularly interesting from a peripheral standpoint is that every single tracked pro uses a wireless mouse â€” the only title with 100% wireless adoption. The game's fast movement and frequent 180-degree flicks make cable drag genuinely unacceptable at the pro level. The average 4,000Hz poll rate is also the highest of any game, showing OW2 pros are early adopters of cutting-edge wireless technology. There's a strong argument that Overwatch 2 is the most mechanically demanding game in terms of what it asks from a mouse: you need the tracking consistency for beam heroes like Zarya, the flick precision for hitscan DPS, and the rapid 360-degree awareness for dive tanks â€” all in a single match if you're flexing between roles.",
  "Quake Champions": "Quake Champions represents the oldest continuous lineage in competitive FPS â€” the game that literally invented esports deathmatch in the 1990s â€” and its mouse preferences reflect a community that values proven performance over cutting-edge trends. Zowie and Logitech dominate with 35% and 45% brand share respectively, but what's remarkable is how many classic shapes persist: the Zowie EC2-A, FK1, and FK2 are all heavily represented, and toxjq famously still competes with the discontinued Microsoft IntelliMouse 1.1. Only 35% of Quake pros use wireless mice, the lowest adoption rate of any game besides Dota 2, reflecting both the scene's veteran playerbase and the community's skepticism toward anything that hasn't been battle-tested over thousands of hours. The average eDPI of 1,466 sits between tactical shooters and hero shooters â€” higher than CS2's ~860 but lower than Overwatch 2's ~3,275 â€” perfectly matching a game that demands both precision Railgun flicks and rapid 360-degree Lightning Gun tracking. Mouse acceleration is a hotly debated topic unique to Quake, with several top players (k1llsen, cYpheR) using it to get low-sensitivity precision and high-sensitivity rotation speed from a single setup. The Quake pro scene may be small compared to Valorant or CS2, but it contains some of the most mechanically gifted FPS players who have ever lived â€” players who have been perfecting their aim for 15-20+ years.",
  "Deadlock": "Valve's Deadlock shows the Logitech G Pro X Superlight 2 leading at 47%, closely followed by the Razer Viper V3 Pro at 40%, creating another near-duopoly. As a new title, Deadlock's early adopter pro scene is populated by players migrating from other competitive games, bringing their established mouse preferences with them. The 100% wireless adoption and average 3,800Hz polling rate show that Deadlock pros are using cutting-edge setups. The market is split cleanly between Logitech at 53% and Razer at 47%, with no other brand represented.",
  "Call of Duty": "The Razer Viper V3 Pro commands a dominant 50% share in Call of Duty, with the Superlight 2 and DeathAdder V3 Pro splitting the remainder at 25% each. CoD's fast time-to-kill and emphasis on snappy target acquisition rewards the Viper V3 Pro's ultralight weight and low latency optical switches. Razer holds 75% total brand share â€” the highest single-brand dominance in any FPS title â€” largely because the CDL's partnership ecosystem has historically favored Razer-sponsored players, and because the Viper V3 Pro's characteristics genuinely suit CoD's gameplay perfectly. The average eDPI of 4,430 is the highest of any FPS game by a wide margin, reflecting Call of Duty's tradition of much higher sensitivity play compared to tactical shooters. To put that in perspective, the average CoD pro plays at nearly 8x the sensitivity of the average CS2 pro â€” it's almost a different discipline entirely. Every tracked CoD pro uses wireless at 4,000Hz polling, showing the competitive scene has fully embraced high-refresh wireless technology.",
  "Rocket League": "Rocket League's mouse data is limited in our database as the game is predominantly played with controllers at the professional level. The Logitech G Pro X Superlight 2 appears as the only tracked mouse, representing the rare keyboard-and-mouse Rocket League player. Most competitive Rocket League is played with PlayStation or Xbox controllers, making mouse choice largely irrelevant for the majority of the pro scene. Rocket League remains an outlier in esports â€” one of the very few major competitive titles where peripheral choice centers on controller selection rather than mouse specifications.",
};

