    bio: "Marco 'vengeurR' Ragusa is the reigning Quake World Champion and the player who dethroned the old guard to establish himself as the new face of competitive Quake. His 2022 World Championship victory â€” defeating legends like rapha and RAISY on the biggest stage â€” announced a generational shift in arena FPS, proving that the new generation could match and surpass the titans who had dominated for over a decade. Born in Italy, vengeurR represents a country with deep roots in Quake history dating back to Stermy and the early Italian Quake scene, and his ascent to world champion status revitalized Italian arena FPS. His aim is devastatingly precise, with Lightning Gun accuracy percentages that consistently rank among the highest in competitive play, and his movement combines the speed of modern Quake Champions with fundamentals inherited from studying Quake Live demos. Sponsored by Myztro Gaming, he runs the G Pro X Superlight at an unusually low 400 DPI with 3.21 sensitivity for an eDPI of just 1284 â€” one of the lowest in the Quake scene, reflecting his confidence in arm-aiming and precision over speed.",
